import React, { Component } from "react";
import "./Node.css";

class Node extends Component {
  render() {
    const { isStart, isFinish, isWall } = this.props;
    const specialName = isFinish
      ? "-Finish"
      : isStart
      ? "-Start"
      : isWall
      ? "-Wall"
      : "";
    console.log(`node${specialName}`);
    return <div id={`node-${row}-${col}`} className={`node${specialName}`} />;
  }
}
export default Node;
